import React from "react";
import darwinGamers from '../darwin-gamers';

class DarwinTourney extends React.Component {
    state = {
        gamers: darwinGamers
    };
    render(){
        return(
            <h1>Darwin Tourney</h1>
        )
    }
}

export default DarwinTourney;
